import React,{ useState } from 'react';
import {Link,Outlet,useNavigate} from 'react-router-dom';
import axios from 'axios';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBInput,
  MDBIcon,
 
}
from 'mdb-react-ui-kit';

function Contact() {
    const history=useNavigate();
    const [email,setEmail]=useState('')
    const [name,setName]=useState('')
    const [password,setPassword]=useState('')

    async function submit(e){
         e.preventDefault()

         try{
            await axios.post("/http://localhost:3000/",{
              name,email,password
            })
            .then(res =>{
               if(res.data==="exist"){
                   history("/home",{state:{id:name}})
               }
               else{
                alert("New User")
               }
            })
         }
         catch(e){
            alert("wrong details")
         }
    }
  return (
    <>
    <Outlet />
    <MDBContainer fluid>
      
      <MDBCard className='text-black m-5' style={{borderRadius: '25px'}}>
        <MDBCardBody>
          <MDBRow>
            <MDBCol md='10' lg='6' className='order-2 order-lg-1 d-flex flex-column align-items-center'>

              <p classNAme="text-center h1 fw-bold mb-5 mx-1 mx-md-4 mt-4">Sign up</p>

              <div className="d-flex flex-row align-items-center mb-4 ">
                <MDBIcon fas icon="user me-3" size='lg'/>
                <MDBInput label='Your Name' id='form1' type='text' onChange={((e)=>{setName})}  className='w-100'/>
              </div>

              <div className="d-flex flex-row align-items-center mb-4">
                <MDBIcon fas icon="envelope me-3" size='lg'/>
                <MDBInput label='Your Email' id='form2' onChange={((e)=>{setEmail})} type='email'/>
              </div>

              <div className="d-flex flex-row align-items-center mb-4">
                <MDBIcon fas icon="lock me-3" size='lg'/>
                <MDBInput label='Password' id='form3' onChange={((e)=>{setPassword})}  type='password'/>
              </div>

             
            
            <Link to='/home'>
              <MDBBtn className='mb-4' size='lg' onClick={submit}>Register</MDBBtn>
              <p className="signup-p">Not Now</p>
            </Link>
            </MDBCol>

            <MDBCol md='10' lg='6' className='order-1 order-lg-2 d-flex align-items-center'>
              <MDBCardImage src='https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-registration/draw1.webp' fluid/>
            </MDBCol>

          </MDBRow>
        </MDBCardBody>
      </MDBCard>
     
    </MDBContainer>
    </>
  );
}

export default Contact;
